import { Box, Button, Grid} from "@mui/material";
import React from "react";
import logo3 from "../images/logo3.png";


const Header = () => {
  return (
    <Grid container sx={{ background: "#1B1B1B", padding: 2, alignItems:"center"}}>
      <Grid item xs={12} md={3}>
      <Box sx={{ display: "flex", alignItems: "center", gap: 1 }}>
          <img src={logo3} alt="Logo" style={{ height: "80px", width: "80px" }} />
        </Box>
      </Grid>
      <Grid item xs={12} md={9}>
        <Box sx={{display:"flex", justifyContent:"flex-end", gap:7}}>
            <Button sx={{ backgroundColor: "white", color:'pink',"&:hover":{backgroundColor:'#1B1B1B', transform: "scale(1.05)"}}}>
              Home
            </Button>
            <Button sx={{ backgroundColor: "white",color:'pink', "&:hover":{backgroundColor:'#EBB866', transform: "scale(1.05)"}, }}>
              About us
            </Button>
            <Button sx={{ backgroundColor: "white", color:'pink',"&:hover":{backgroundColor:'#EBB866', transform: "scale(1.05)"}}}>
              Contact us
            </Button>
        </Box>
      </Grid>
    </Grid>
  );
};

export default Header;
